import * as React from "react";
import { array } from 'one-core';

interface Props {
}

export const NV = (props: any) => {
    const { name, value } = props;
    const values = array(value).map((v: any, index) => (
        <>
            {(index > 0) ? <br /> : undefined}
            {v}
        </>
    ));

    return (
        <>
            <p style={{ margin: '0px', padding: '0px', fontSize: '0.95rem' }}>
                <strong style={{ margin: '0px', padding: '0px', fontSize: '0.95rem' }}>
                    <small style={{ margin: '0px', padding: '0px', fontSize: '0.95rem' }}>
                        {name}:
                </small>
                </strong>
            </p>
            <p style={{ marginBottom: '4px', padding: '0px', fontSize: '.85rem' }}>
                {values}
            </p>
        </>
    )
}
